import React from "react";
import Typed from 'typed.js';
import "./Home.css";

function Home() {
    const el = React.useRef(null);

    React.useEffect(() => {
        const typed = new Typed(el.current, {
            strings: ["Developer.", "Student.", "n Enthusiast.", "Profestional Coder."],
            typeSpeed: 30,
            backSpeed: 50,
            loop: true,
        });

        return () => {
            typed.destroy();
        };
    }, []);

    return (
        <div id="home">
            <div id="home-text">
                <h1>Hi, I'm <span id="name">Prajwal Shrimali</span></h1>
                <h2>a <span ref={el} /></h2>
                <p>
                    {/* I'm a code-crunching explorer, fearlessly delving into the depths of the digital abyss to 
                    unlock its secrets. With the heart of a perpetual student and the spirit of an eternal 
                    enthusiast, I'm driven by a relentless curiosity to unravel the mysteries of our worldâ€”one 
                    line of code at a time. Care to join me on this exhilarating journey, where we uncover hidden 
                    gems and ignite our boundless curiosity? Oh, and by the way, I'm also a dedicated student of 
                    technology. */}
                    I'm a code-cracking, mystery-solving dynamo! As a developer, student, and all-around enthusiast, 
                    I'm on a thrilling quest to unravel the secrets of our digital universe. Join me in this 
                    adrenaline-fueled adventure as we unlock the wonders of technology and embrace the excitement 
                    of discovery!
                </p>
            </div>
            <div id="home-image">
                <img src="https://via.placeholder.com/300" alt="Prajwal Shrimali Display Pic" />
            </div>
        </div>
    );
}

export default Home;
